import React, { useState } from "react"

export default function Todos() {
  const [todos, setTodos] = useState([{ id: 1, title: "study English" }])

  const render = todos.map((todo) => {
    return (
      <div>
        <div>Todos Title</div>
      </div>
    )
  })

  return (
    <div>
      <h1>Todos</h1>
      <div>{render}</div>
    </div>
  )
}
